import React from 'react';
import './AncientAgora.scss';

const AncientAgora : React.FC = props => {
    return (
        <div className={`ancient-agora`}>
            <h2>Ancient Agora</h2>
            <div className={`practical-info`}>
                <b>Time spent there:</b> 1h40<br></br>
                It opens at 8:00 but when we went, the museum was being cleaned until 10:00.<br></br>
                <b>Entrance:</b> <a href='https://goo.gl/maps/HR4MCPKD9Nn9jb336' target='_blank'>here</a>
            </div>
            <div>
                <p>
                    The Ancien Agora was the center of public life and Athenian democracy, where people used to walk, chit chat, do business, take care of administrative stuff, pray, vote ...
                </p>
                <p>
                    Panathenaic way : way that goes diagonally through the main square and leads to Acropolis<br></br>
                    Temple of Hephaistos : super well preserved, on a small hill<br></br>
                    Ruins : Middle Stoa (longest building), a theater (Aggrippa odeion, burnt then Romains built a concert hall at the same spot and reused 4/6 statues of Giants and Titans)<br></br>
                    Stoa of Attalos : reconsitution du vrai, pr√©au + 21 shops at the back, part of them now house a museum. Upstairs, models of Acropolis and ancient agora.<br></br>
                </p>
            </div>
        </div>
    );
}

export default AncientAgora;
